import React, { useState } from "react";
import { ImageBackground, View, Switch, StyleSheet, SafeAreaView } from "react-native";

const App = () => {
  const [isEnabled, setIsEnabled] = useState(false);
  const toggleSwitch = () => setIsEnabled(previousState => !previousState);

  const image = { uri: "https://64.media.tumblr.com/7da9c916f4731183918695c5b5af70f1/tumblr_p94ja0lQ0U1tlslxzo1_500.jpg" };

  return (
    <SafeAreaView style={{ flex: 1, backgroundColor: isEnabled ? "black" : "white" }}>
      <ImageBackground source={image} resizeMode="cover" style={styles.image}>
        <Switch
          trackColor={{ false: "black", true: "white" }}
          thumbColor={isEnabled ? "black" : "white"}
          ios_backgroundColor="black"
          onValueChange={toggleSwitch}
          value={isEnabled}
        />
      </ImageBackground>
    </SafeAreaView>
  );
}

const styles = StyleSheet.create({
  image: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
  },
});



export default App;
